import styled from 'styled-components'
import Video from '../../videos/video.mp4'

const SectionContainer = styled.div`
    background: #0c0c0c;
    display: flex;
    justify-content: center;
    align-items: center;
    padding: 0 30px;
    height: 800px;
    position: relative;
    z-index: 1;

    /* @media screen and (max-width: 960px) {
        transition: 0.8s all ease;
    } */
`
const SectionBg = styled.div`
    position: absolute;
    top: 0;
    right: 0;
    bottom: 0;
    left: 0;
    width: 100%;
    height: 100%;
    overflow: hidden;
`
const VideoBg = styled.video`
    width: 100%;
    height: 100%;
    -o-object-fit: cover;
    object-fit: cover;
    background: #232134;
`

const Section = () => {
    return (
        <SectionContainer>
            <SectionBg>
                <VideoBg autoPlay loop muted src={Video} type='video/mp4' />
            </SectionBg>
        </SectionContainer>
    )
}

export default Section
